import {useState} from 'react';
import WhiteKey from './WhiteKey'
import BlackKey from './BlackKey'
import Screen from './Screen'

function Piano() {

  const [text, setText] = useState('')
  const [active, setActive] = useState('')

  if (navigator.requestMIDIAccess) {
    navigator.requestMIDIAccess().then(onMIDISuccess, onMIDIFailure);
  }

  function onMIDISuccess(midiAccess) {

    const inputs = midiAccess.inputs;

    inputs.forEach(input => {
        input.addEventListener('midimessage', onMIDIMessage);
    }
    )
  }

  function onMIDIFailure() {
    console.log('Could not access your MIDI devices.');
  }

  function onMIDIMessage(event) {
    let note = event.data[1];

    let octave = Math.floor(note / 12) - 1;
    let noteName = note % 12;
    let noteNames = ['C', 'C#', 'D', 'D#', 'E', 'F', 'F#', 'G', 'G#', 'A', 'A#', 'B'];
    let noteNameString = noteNames[noteName];
    let noteString = noteNameString + octave;
    setText(noteString);
    setActive(noteString);

  }

  return (
    <div className='piano'>
      <div className='controller'>
        <Screen text = {text}/>
      </div>

      <div className='keys'>
        <WhiteKey note='A0' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='A#0' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='B0' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='C1' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='C#1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='D1' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='D#1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='E1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='F1' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='F#1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='G1' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='G#1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='A1' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='A#1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='B1' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='C2' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='C#2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='D2' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='D#2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='E2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='F2' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='F#2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='G2' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='G#2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='A2' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='A#2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='B2' setText = {setText} active = {active} setActive = {setActive}/>
        <WhiteKey note='C3' setText = {setText} active = {active} setActive = {setActive}/>
        <BlackKey note='C#3' setText = {setText} active = {active} setActive = {setActive}/>

    </div>
  </div>
  )
}

export default Piano
